window.bookSummaryJSON = "<p>January 2043. The Vogthar Horde has come, and they bring real death with them. Not even players are safe from the power of Malware Blades....</p> <p>Worse, the Realm of Order, dominion of the Overmind Sophia, is in danger - slowly being corrupted by an ancient evil, the Lich Priest. And if he is successful, it could mean the end of Sophia and the downfall of the Crimson Alliance.&nbsp;</p> <p>Grim Jack never thought he’d find himself siding with the Empire, but now that this terrible new threat has arrived, making friends of old enemies may be the only way to survive.&nbsp;&nbsp;</p>"; 
